import React from "react";
import {NavbarData} from "./NavbarData";
import {Link} from "react-router-dom";
import styles from "./Navbar.css";
import SocialBar from "./SocialBar";

class Navbar extends React.Component{
  constructor(props){
    super(props)
    this.openModal = this.openModal.bind(this);
  }
  openModal(e){
      alert(e.target.key);
  };
  render(){
    return(
      <nav className = "tab" style = {{height: "500px"}}>
          <ul className = "tabs list-unstyled text-center">
            {NavbarData.map((item, index) => {
              return(
                <li key = {index} className = "tab py-4">
                  <Link key = {index} to = {item.path} className = {item.cName} onClick = {this.openModal} style = {{textDecoration: "none"}}>
                    <span key = {index}>{item.title}</span>
                  </Link>
                </li>
              )
            })}
          </ul>
          <SocialBar/>
        </nav>
  );
}
}

export default Navbar;
